import './App.css';
import * as Callbridge from '@iotum/callbridge-js';
import { useEffect } from 'react';

function newMeeting() {
  const widget = new Callbridge.Meeting({"domain":"iotum.callbridge.rocks","container":"#ifrm_container"}, 5821515, {"name":"Guest","view":"left_side_speaker","tiles":4,"resolution":180,"mute":{"mic":true,"camera":true}});
}

// function dashboard() {
//   const widget = new Callbridge.Dashboard({"domain":"iotum.callbridge.rocks","container":"#ifrm_container"}, Callbridge.Team, {});

//   return widget;
// }

function App() {
  useEffect(() => {
    newMeeting();
    //dashboard();
  });
  return (
    <div className="App">
      <div id="ifrm_container"></div>
    </div>
  );
}

export default App;
